import React from "react";

interface IProps {
  url: string;
}

const AudioMessage: React.FC<IProps> = ({ url }) => {
  return (
    <audio controls>
      <source src={url} type="audio/ogg" />
      <source src={url} type="audio/mpeg" />
    </audio>
  );
};

export default AudioMessage;
